import React from 'react';

function Artists() {
    return (
        <div>
            <h1>Artists</h1>
            <ul>
                <li>Wojciech Babski</li>
                <li>Warren Chang</li>
                <li>Aurelio Bruni</li>
            </ul>
        </div>
    );
}

export default Artists;
